import react from "react";
import styled from "styled-components";
import { useNavigate } from "react-router-dom";
import { ToggleButtonGroup, ToggleButton } from "react-bootstrap";
import React from "react";
import Header from "./Header";
const SearchCheck = styled.div`
  width: 100%;
  height: 100px;
  margin-top: 50px;
  display: flex;
  flex-direction: row;
  justify-content: center;
  input {
    height: 40px;
    width: 200px;
    border-radius: 3px;
  }
  button {
    height: 40px;
    border-radius: 3px;
  }
  div {
    height: 40px;
  }
`;
const RadioButton = styled.div`
  width: 100%;
  height: 30px;
  display: flex;
  flex-direction: row;
  justify-content: center;
  label {
    padding: 5px;
  }
`;

function Home() {
  return (
    <div>
      <Header />
      <SearchCheck>
        <input placeholder="검색어" type="text" />
        <button>검색</button>
      </SearchCheck>
      <RadioButton>
        <label>
          <input type="radio" name="id" value="id" /> 작성자
        </label>
        <label>
          <input type="radio" name="text" value="text" /> 일반텍스트
        </label>
        <label>
          <input type="radio" name="hashtag" value="hashtag" /> Hashtag
        </label>
      </RadioButton>
    </div>
  );
}

export default Home;
